import styled from "styled-components";

const Boton = styled.button`
.background-color: #81638b; /* Green */
border: none;
color: #503459;
padding: 15px 32px;
text-align: center;
text-decoration: none;
display: inline-block;
font-size: 16px;

`;

export default Boton;
